import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Obituary ()
{
    const [data, setData] = useState([])

    useEffect( () =>
    {
        axios.get( 'http://localhost:8081/' )
            .then( res => setData(res.data) )
            .catch( err => console.log( err ) );
    }, [] )

    console.log('Render data:', data);
    
    return (
        <div>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Thumbnail</th>
                            <th>Title</th>
                            <th>Packages</th>
                            <th>Status</th>
                            <th>Time</th>
                            <th>Action</th>
                        </tr>
                    </thead>

                    <tbody>
                        { data.map( ( post, index ) =>
                            {
                            return <tr key={ index }>
                                <td>{ post.thumbnail }</td>
                                <td>{ post.title }</td>
                                <td>{ post.packages }</td>
                                <td>{ post.status }</td>
                                <td>{ post.time }</td>
                                </tr>
                            }
                        ) }
                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default Obituary
